import { Link, Typography } from "@material-ui/core";
import { makeStyles } from "@material-ui/core";
import card from "../image/card.jpeg";
import React from "react";
const useStyles = makeStyles((theme) => ({
  card: {
    height: "100vh",
    display: "flex",
    justifyContent: "space-around",
    alignItems: "center",
  },
  card1: {
    width: "217px",
    minHeight: "230px",
    border: "1px solid",
    borderRadius: "10px",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
  },
  img1: {
    height: "120px",
  },
  title1: {
    fontSize: "20px",
    paddingTop: "20px",
  },
  link: {
    textDecoration: "none",
  },
}));

export default function Card() {
  const classes = useStyles();

  return (
    <div className={classes.card}>
      <div className={classes.card1}>
        <Link href="http://www.google.com" className={classes.link}>
          <img src={card} alt="img1" className={classes.img1} />
          <Typography className={classes.title1}>Thẻ bài</Typography>
        </Link>
      </div>
      <div className={classes.card1}>
        <img src={card} alt="img1" className={classes.img1} />
        <Typography className={classes.title1}>Thẻ bài</Typography>
      </div>
      <div className={classes.card1}>
        <img src={card} alt="img1" className={classes.img1} />
        <Typography className={classes.title1}>Thẻ bài</Typography>
      </div>
      <div className={classes.card1}>
        <img src={card} alt="img1" className={classes.img1} />
        <Typography className={classes.title1}>Thẻ bài</Typography>
      </div>
    </div>
  );
}
